import React from 'react'

function AddToCart({ info }) {
  return (
    <div className="add-to-cart-main">
        <h1 className="add-to-cart-price"><b>${info[0].price}</b></h1>
        <div>
            <img src='https://cdn-icons-png.flaticon.com/512/35/35439.png'></img>
        </div>
    </div>
  )
}

export default AddToCart
